    height: 100%;
    top: 10%;
    display: none;
    background-color: rgba($color: #000000, $alpha: .5);
    justify-content: center;
    align-items: center;
    z-index: 10;

    &__content {
        background-color:$black;
        width: 35rem;
        height: 43rem;
        border-radius: 2rem;
        padding: 3rem;
        display: flex;
        justify-content: center;
        align-items: center;
        position: relative;

        .icon {
            position: absolute;
            color: $white;
            top: 2rem;
            right: 3rem;
            font-size: $regular2;
            cursor: pointer;

            transition: all .3s;

            &:hover {
                transform: scale(1.2);
            }
        }


        form {
            display: flex;
            flex-direction: column;
            justify-content: center;
            width: 90%;
            margin-left: auto;
            margin-right: auto;
            position: relative;
            color: $white;


            input {
                &[type="email"], &[type="text"] {
                    width: 100%;
                    height: 2.5rem;
                    padding-left: .8rem;
                    background-color: transparent;
                    color: $white;
                    border: 0.15rem solid $white;
                    border-radius: 1rem;
                    margin-bottom: 1rem;
                    font-size: $regular

                    
                }

                &:focus {
                    outline: none;
                    border: 0.1875 solid $yellow;
                }
                
                &:-webkit-autofill {
                    box-shadow: 0 0 0px 1000px $black inset;
                    -webkit-text-fill-color: $white;
                }
                
            }

            #message-box {
                background-color: transparent;
                color: $white;
                font-size: $regular;
                border: 0.15rem solid $white;
                border-radius: 1rem;
                margin-bottom: 1rem;
                padding-left: .8rem;
                padding-top: .2rem;
                resize: none;
                width: 100%;


                &:focus {
                    border: 0.1875 solid $yellow;
                    outline: none;
                }
            }
            

            .submit {
                @include button-style;
                
                width: 14rem;
                height: 2.8rem;
                font-size: $regular2;
                font-weight: 600;
                background-color: $white;
                color: $black;
                cursor: pointer;

                transition: all .5s;

                &:hover {
                    color: $white;
                    background-color: $black;
                    border: 0.125rem solid $white;

                }
            }
            
        }
    }

}

